function IsPlaying() {
  var isPlaying = 0;
  var audios = document.getElementsByTagName('audio');

  for (var i = 0, len = audios.length; i < len; i++) {
    if (audios[i].getAttribute('id') !== "audio_0") if (audios[i].paused == false || audios[i].autoplay) {
      isPlaying++;
    }
  }

  return isPlaying;
}

function PlayNext(el) {
  var index = $('.audio_player').index($(el));
  var next = $('.audio_player')[index + 1]; ////ShowAlert($(next).prop("tagName").toString());

  if ($(next).attr("class") === "audio_player") $(next).trigger('play');
}

